import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };

  names(){
    return (
      this.user
    )
  }
  render(){
    return (
      <table>
        <tr style={{color:"black",fontSize:"15px",display:"flex"}}><h1>Nomes</h1></tr>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px",flexDirection:"column"}}>{this.myUserList.map(user=>user.user_first_name)}</td>

        <tr style={{color:"black",fontSize:"15px",display:"flex"}}><h1>Data de Nascimento</h1></tr>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px"}}>{this.myUserList.map(user=>user.user_birth_date)}</td>

        <th style={{color:"black",fontSize:"15px",maxWidth:"200px",display:"flex"}}><h1>Genero</h1></th>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px"}}>{this.myUserList.map(user=>user.user_gender)}</td>

        <th style={{color:"black",fontSize:"15px",maxWidth:"20%",display:"flex"}}><h1>Info</h1></th>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px",display:"table-column-group"}}>{this.myUserList.map(user=>user.user_gender)}</td>

        <th style={{color:"black",fontSize:"15px",maxWidth:"20%",display:"flex"}}><h1>Endereço</h1></th>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px",display:"table-column-group"}}>{this.myUserList.map(user=>user.user_address_id)}</td>

        <th style={{color:"black",fontSize:"15px",maxWidth:"20%",display:"flex"}}><h1>Salario</h1></th>
          <td style={{color:"black",fontSize:"12px",maxWidth:"20px",display:"table-column-group"}}>{this.myUserList.map(user=>user.user_first_name)}</td>
      </table>
    )
  };

}


export default Table;
